			case 'years_ago': return '{years, plural, one {# year} other {# years}} ago';
			case 'yes': return 'Yes';
			case 'you_dont_have_any_shared_links': return 'You don\'t have any shared links';
			case 'zoom_image': return 'Zoom Image';
			default: return null;
		}
	}
}

